const CocktailSpecs = (props) => {
  console.log(props)
  return (
    <div className={`ui card ${props.width} wide column`}>
      <div className="image">
        // <img alt="" src={props.cocktail.image} />
      </div>
      <div className="content">
        <a className="header">{props.cocktail.name}</a>
        <div className="meta">
          <span className="date">{props.cocktail.source}</span>
        </div>
        <div className="description">
          {props.cocktail.description}
        </div>
      </div>
      <div className="extra content">
        <a>
          <i className="user icon"></i>
          // {props.dog.likes}
        </a>
      </div>
    </div>
  )
}

export default CocktailSpecs;
